export default function HeroSection() {
    return (
        <section id="heroSection" className="hero--section">
           <div className="hero--section--content--box">
                <div className="hero--section--content"> 
                    <p className="section--title">Hi, I'm Abdulla Abdulla</p>
                    <h1 className="hero--section--title">
                        <span className="hero--section-title--color">Computer Science: <br/> Software Engineering Student</span>
                    </h1>
                    <p className="hero--section--description">Welcome to my portfolio, I am actively seeking a co-op job where I can apply my full-stack development skills. <br/> I have built projects on my own time and from assignments assigned at Carleton University using HTML, CSS, JavaScript, React, Node.js, Express, and PostgreSQl, <br/> as well as Java, Python, and C. <br/> I enjoy working with both frontend and backend systems. I have become familiar with tools like VS Code, Git/GitHub, and ORacle Vi </p>  
                </div>
            </div>
        </section>
    );
    
}
